import {reqGetSearchInfo} from "@/api"
//search模块的小仓库
const state = {};
const mutations = {};
const actions = {
  async getSearchList({commit},parmas){
    let result= await reqGetSearchInfo(parmas);
    if (result.code == 200) {
      commit("CATERYLIST", result.data);
    }
  }
};
const getters = {};
export default {
  state,
  mutations,
  actions,
  getters,
};
